import Button from "@mui/material/Button";

function SMButton(props) {
  const { label, onClick,fullWidth } = props;
  return (
    <>
      <Button onClick={onClick}   fullWidth={fullWidth}  variant="contained">
        {label}
        
      </Button>
    </>
  );
}
export default SMButton;
